%% 2D Finite Diference Time Domain Analysis
% Yee's Method
% Author: Alex Santiago Vargas
%
% Purdue University
% ECE 618: Numerical Electromagnetics

% Setup environment
clear; clc; close all; % Clean up MATLAB
format shortEng; % Engineering number format
colormap("winter")

% Define constants
epsilon_0=8.85418781e-12; % [F/m] Permitivity of free space
mu_0=4*pi*1e-7; % [H/m] Permeability of free space
c = 1/sqrt(epsilon_0*mu_0); % [m/s] Speed of light

% Solution frequency
f = 33e9; % [Hz] Problem center frequency
lambda = c/f; % Wavelength
T = 1/f; % [1/s] Period
%%
%[text] ## Select Experiment
XP = 2; % Select numerical experiment to replicate results
% 0: Radiating infinite wire
% 1-3: N-Slit experiment with # of slits
% 11-14: PEC Scattering
% 21-24: Dielectric Scattering
% 31: Antenna
%%
%[text] ## Define simulation domain
if XP == 0
    f = 2.4e9; % [Hz] Problem center frequency
    lambda = c/f; % Wavelength
    T = 1/f; % [1/s] Period

    x_dim = 8*lambda; % Size of simulation domain in x direction
    y_dim = 8*lambda; % Size of simulation domain in y direction
    t_stop = 6*T; % [s] Simulation stopping time
    J0 = 1e-3; % [A] Normalized Current Density
    Ez_max = 150e-6; % Set amplitude limits
elseif XP > 0 & XP <= 10
    x_dim = 8*lambda; % Size of simulation domain in x direction
    y_dim = 8*lambda; % Size of simulation domain in y direction
    t_stop = 10*T; % [s] Simulation stopping time
    J0 = 100e-3; % [A] Normalized Current Density
    
    if XP == 1
        Ez_max = 3e-6; % Set amplitude limits
    elseif XP == 2
        Ez_max = 6e-6; % Set amplitude limits
    elseif XP == 3
         Ez_max = 9e-6; % Set amplitude limits
    elseif XP == 4
         Ez_max = 12e-6; % Set amplitude limits
    else
        Ez_max = 50e-6; % Set amplitude limits
    end
elseif XP >= 11 & XP <= 30
    x_dim = 8*lambda; % Size of simulation domain in x direction
    y_dim = 8*lambda; % Size of simulation domain in y direction
    t_stop = 8*T; % [s] Simulation stopping time
    J0 = 100e-3; % [A] Normalized Current Density
    Ez_max = 500e-6;  % Set amplitude limits
elseif XP >= 31
    x_dim = 10*lambda; % Size of simulation domain in x direction
    y_dim = 10*lambda; % Size of simulation domain in y direction
    t_stop = 15*T; % [s] Simulation stopping time
    J0 = 100e-3; % [A] Normalized Current Density
    Ez_max = 40e-6;  % Set amplitude limits
end


% Define grid of free space with (x,y) coordinate convention
dx = lambda/20; % Spacing between grid points in x direction
dy = dx; % Spacing between grid points in y direction

% Define PML Parameters
pml_dim = 2*lambda/min(dx,dy); % PML thickness in grid points
m = 5; % PML polynomial smoothing
PML_loss = (m+1)/(2*pml_dim*min(dx,dy)*sqrt(mu_0/epsilon_0))*log(20*log10(150)); % PML loss factor (set to -90 dB)


% Set time stepping
CFL = 1/(c*sqrt(dx^-2+dy^-2)); % Calculate CFL criterion
dt = 0.99*CFL; % Set time stepping

% Validate CFL stability criterion
if dt > CFL
    fprintf("[ERROR]: CFL stability criteria is not sattisfied. Please choose a proper time step")
    return 
end
clear CFL

% Base grid shape, number of grid points for each dimension
Nx = size(0:dx:x_dim,2)-1+2*pml_dim;
Ny = size(0:dy:y_dim,2)-1+2*pml_dim;

% Define field matrices
Hx = zeros(Nx,Ny); Hx_p = Hx;
Hy = zeros(Nx,Ny); Hy_p = Hy;
Bx = zeros(Nx,Ny); Bx_p = Bx;
By = zeros(Nx,Ny); By_p = By;
Dz = zeros(Nx,Ny); Dz_p = Dz;
Ez = zeros(Nx,Ny); Ez_p = Ez;

% Define PML loss
pml_sigmaX = zeros(Nx,Ny);
for i = 1:pml_dim
    pml_sigmaX(i,:) = PML_loss * ((pml_dim-i+1)/pml_dim)^m; % Taper left
    pml_sigmaX(end-pml_dim+i,:) = PML_loss * (i/pml_dim)^m; % Taper right
end
pml_sigmaX = sparse(pml_sigmaX); % Create sparse matrix to reduce space
pml_sigmaY = pml_sigmaX'; % Transpose to get Y-direction PML loss
pml_sigmaZ = zeros(Nx,Ny); % No loss in Z direction (2D simulation)

% Plot PML loss
fig = figure(); %[output:1b9a3df3]
set(fig,'Units','normalized','Position',[0 0 0.5 0.5]);  %[output:1b9a3df3]
subplot(1,2,1) %[output:1b9a3df3]
    imagesc(pml_sigmaX') %[output:1b9a3df3]
    title("\sigma^{'}_{x}") %[output:1b9a3df3]
    set(gca,'YDir','normal'); %[output:1b9a3df3]
    daspect([1 1 1]) %[output:1b9a3df3]
    colorbar %[output:1b9a3df3]

subplot(1,2,2) %[output:1b9a3df3]
    imagesc(pml_sigmaY') %[output:1b9a3df3]
    title("\sigma^{'}_{y}") %[output:1b9a3df3]
    set(gca,'YDir','normal'); %[output:1b9a3df3]
    daspect([1 1 1]) %[output:1b9a3df3]
    colorbar %[output:1b9a3df3]
%%
%[text] ## Setup simulation
% Material properties defined in the grid
epsilon = ones(Nx,Ny).*epsilon_0; % Array for permittivity
mu = ones(Nx,Ny).*mu_0; % Array for permeability
sigma = zeros(Nx, Ny); % Array for conductivity

%% Dielectrics
% Set dielectric layer
% epsilon_r = 2.8;
% epsilon(1:Nx/4,:) = epsilon_r*epsilon_0;

% Set two dielectric layers
% epsilon_r = 2.8;
% epsilon(1:Nx/8,:) = epsilon_r*epsilon_0;
% epsilon(Nx/8:Nx/4,:) = epsilon_r/2*epsilon_0;

% Setup dielectric with different crossections and permittivities
if XP == 21
    % quarter wavelength radius dielectric cylinder with 2.8 epsilon
    epsilon_r = 2.8;
    R = lambda/4/dx;
    epsilon(boolean(circleArray(Nx,Ny, R, 3*Nx/4, Ny/2))) = epsilon_r*epsilon_0;
elseif XP==22
    % quarter wavelength radius dielectric cylinder with 1.8 epsilon
    epsilon_r = 1.8;
    R = lambda/4/dx;
    epsilon(boolean(circleArray(Nx,Ny, R, 3*Nx/4, Ny/2))) = epsilon_r*epsilon_0;
elseif XP == 23
    % one wavelength radius dielectric cylinder with permitivitty 2.8
    epsilon_r = 2.8;
    R = lambda/dx;
    epsilon(boolean(circleArray(Nx,Ny, R, 3*Nx/4, Ny/2))) = epsilon_r*epsilon_0;
elseif XP == 24
    % Cube with infinite z and permitivitty 3.5
    epsilon_r = 3.5;
    R = lambda;
    epsilon(boolean(rectangleArray(Nx,Ny,R/dx, R/dy, Nx/2, 3*Ny/4))) = epsilon_r*epsilon_0;
end

% Setup dielectric lens with elipsoid crossection
center_offset_a = 0;
if XP >= 31 & XP <= 40
    epsilon_r = 2.8;
    R = 2*lambda/dx;
    a=round(R/sqrt(1-1/epsilon_r));
    b=R;
    % center_offset=round(sqrt(a^2-b^2));
    center_offset_a=round(R/sqrt(epsilon_r-1));
    epsilon(boolean(ellipseArray(Nx,Ny,a,b, pml_dim+lambda/2/dx+center_offset_a, Ny/2))) = epsilon_r*epsilon_0;
    epsilon(1:pml_dim+lambda/4/dx, :) = epsilon_0; % Cut back portion
end

%% Conductors
% Set conducting plane for N slit experiment
if  (XP > 0 & XP <= 10) | XP > 30
    slit_w = lambda/4/dy; % Slit width
    slit_spacing = 2*lambda/dy; % Slit spacing (center to center)
    if XP <= 10
        slit_n = XP; % Number of slits
        x_offset = int16(Nx/4);
    elseif XP > 30
        slit_n = 1;
        x_offset = pml_dim+lambda/2/dx;
    end
    center_offset = Ny/2 - (slit_n-1)*slit_spacing/2;  % Offset to make slits symmetrical
    
    sigma(x_offset,:) = 1e10;  % Plane conductivity
    for n = 0:slit_n-1
        sigma(x_offset, center_offset-round(slit_n/2-1)-2:center_offset+round(slit_n/2+1)+2) = 0;
        center_offset = center_offset + slit_spacing;
    end

    if XP >= 31
        % Remove the PEC that is not behind the dielectric antenna
        tmp = boolean(ellipseArray(Nx,Ny,a,b, pml_dim+lambda/2/dx+center_offset_a, Ny/2));
        sigma(pml_dim+lambda/2/dx,:) = sigma(pml_dim+lambda/2/dx,:) .* tmp(pml_dim+lambda/2/dx,:);
    end
end

% Conductive waveguide
if XP >= 31
    waveguide_w = lambda/4/dy; % Waveguide width
    center_offset = Ny/2; % Ny/2 - (slit_n-1)*slit_spacing/2;  % Offset to make slits symmetrical

    sigma(1:pml_dim+lambda/2/dx,center_offset-round(waveguide_w/2-1)) = 1e10;
    sigma(1:pml_dim+lambda/2/dx,center_offset+round(waveguide_w/2)+1) = 1e10;
end

% Set conducting crossections
if XP == 11
    % Wavelength PEC cylinder
    R = lambda/2;
    sigma = sigma+1e10*circleArray(Nx,Ny,R/dx, 3*Nx/4, Ny/2);
elseif XP == 12
    % Three Wavelength PEC cylinder
    R = 1.5*lambda;
    sigma = sigma+1e10*circleArray(Nx,Ny,R/dx, 3*Nx/4, Ny/2);
elseif XP == 13
    % Offset PEC cube
    R = 1.5*lambda;
    sigma = sigma+1e10*boolean(rectangleArray(Nx,Ny,R/dx, R/dy, 3*Nx/4, Ny/2));
elseif XP ==14
    % Large Cylinder
    R = 2.5*lambda;
    sigma = sigma+1e10*circleArray(Nx,Ny,R/dx, 1*Nx/4, Ny/2);
end


% Add conductors and PML
pml_sigmaX = pml_sigmaX + sigma;
pml_sigmaY = pml_sigmaY + sigma;

%% Sources
% Define source
Jz = zeros(Nx,Ny);
if XP == 0 | (XP > 10 & XP <= 30)
    Jz(Nx/2,Ny/2) = 1; % Infinite line current source in z-direction at the center
end

if XP > 0 & XP <=10
    Jz(2,:) = 1; % Infinite sheet current in the zy-plane
end

if XP >= 31
    Jz(pml_dim+1,center_offset-round(waveguide_w/2-1):center_offset+round(waveguide_w/2+1)) = 1; % Waveguide input
end

% Normalizing the current to 100mA/m
Jz = J0*Jz./sum(Jz,"all");

% Signal response
if XP == 0
    sigma_t = T/2; % Standard deviation for source Gaussian envelope
    t0_source = 0; % [s] Source turning on at t0 time
elseif  XP >= 0 & XP <= 30
    sigma_t = 2*T; % Standard deviation for source Gaussian envelope
    t0_source = 2*sigma_t;
elseif  XP >= 31
    sigma_t = 2*T; % Standard deviation for source Gaussian envelope
    t0_source = 2*sigma_t;
end
%%
%[text] ## Plot simulation domain
figure(); % Plot input signal %[output:8ad83ca4]
    t=0:dt:t_stop;
    Jt = sin(2*pi*f*t);
    if XP > 0
        Jt = Jt.*exp(-((t-t0_source).^2/sigma_t^2).^2/2); % Apply Gaussian envelope
    elseif XP == 0
        Jt = Jt.*(1-exp(-t/sigma_t/2));
    end

    plot(t,Jt); %[output:8ad83ca4]
    axis tight %[output:8ad83ca4]
    title("Excitation Signal",'FontSize',14) %[output:8ad83ca4]
    xlabel("time [s]",FontSize=12) %[output:8ad83ca4]
    ylabel("Amplitude",FontSize=12) %[output:8ad83ca4]
clear Jt t;

figure(); %[output:448ac032]
set(gcf,'Units','normalized','Position',[0 0 1 1]);  %[output:448ac032]
    subplot(2, 2, 1); % Plot relative permittivity %[output:448ac032]
        imagesc((epsilon/epsilon_0)') %[output:448ac032]
        title("Relative Permitivity",FontSize=14) %[output:448ac032]
        xlabel("X Grid Points",FontSize=12) %[output:448ac032]
        ylabel("Y Grid Points",FontSize=12) %[output:448ac032]
        set(gca,'YDir','normal'); %[output:448ac032]
        daspect([1 1 1]) %[output:448ac032]
        cb = colorbar; %[output:448ac032]
        cb.Title.String = '\epsilon_r'; %[output:448ac032]
    
    subplot(2, 2, 2); % Plot relative permeability %[output:448ac032]
        imagesc((mu/mu_0)') %[output:448ac032]
        title("Relative Permeability",FontSize=14) %[output:448ac032]
        xlabel("X Grid Points",FontSize=12) %[output:448ac032]
        ylabel("Y Grid Points",FontSize=12) %[output:448ac032]
        set(gca,'YDir','normal'); %[output:448ac032]
        daspect([1 1 1]) %[output:448ac032]
        colorbar %[output:448ac032]
        cb = colorbar; %[output:448ac032]
        cb.Title.String = '\mu_r'; %[output:448ac032]

    subplot(2, 2, 3); %[output:448ac032]
        imagesc(sigma') % Plot conductivity %[output:448ac032]
        title("Conductivity",FontSize=14) %[output:448ac032]
        xlabel("X Grid Points",FontSize=12) %[output:448ac032]
        ylabel("Y Grid Points",FontSize=12) %[output:448ac032]
        set(gca,'YDir','normal'); %[output:448ac032]
        daspect([1 1 1]) %[output:448ac032]
        colorbar %[output:448ac032]
        cb = colorbar; %[output:448ac032]
        cb.Title.String = '[S]'; %[output:448ac032]
    
    subplot(2, 2, 4); %[output:448ac032]
        imagesc(Jz') % Plot current source %[output:448ac032]
        title("Current Source",FontSize=14) %[output:448ac032]
        xlabel("X Grid Points",FontSize=12) %[output:448ac032]
        ylabel("Y Grid Points",FontSize=12) %[output:448ac032]
        set(gca,'YDir','normal'); %[output:448ac032]
        daspect([1 1 1]) %[output:448ac032]
        colorbar %[output:448ac032]
        cb = colorbar; %[output:448ac032]
        cb.Title.String = '[A]'; %[output:448ac032]
%%
% Calculate time-independent coefficients
ax = (epsilon./dt + pml_sigmaX./2).^-1;
ay = (epsilon./dt + pml_sigmaY./2).^-1;
az = (epsilon./dt + pml_sigmaZ./2).^-1;
bx = epsilon./dt - pml_sigmaX./2;
by = epsilon./dt - pml_sigmaY./2;
bz = epsilon./dt - pml_sigmaZ./2;

% Time stepping
close all;
tic
for t = 0:dt:t_stop %[output:group:74088fbb]
    % Update source
    Jz_n = Jz(2:end-1,2:end-1).*sin(2*pi*f*t); % Aply Sinusoid input
    if XP > 0
        Jz_n = Jz_n.*exp(-((t-t0_source).^2/sigma_t^2).^2/2); % Apply Gaussian envelope
    elseif XP == 0
        Jz_n = Jz_n.*(1-exp(-t/sigma_t));
    end
    % Update fields
    % Note: Without PML conductivty the E and H reduce to: E=D/epsilon and H=B/mu
    Bx(1:end-1,1:end-1) = ay(1:end-1,1:end-1).*(by(1:end-1,1:end-1).*Bx_p(1:end-1,1:end-1) - (epsilon(1:end-1,1:end-1)./dy).*diff(Ez_p(1:end-1,:),1,2));
    By(1:end-1,1:end-1) = az(1:end-1,1:end-1).*(bz(1:end-1,1:end-1).*By_p(1:end-1,1:end-1) + (epsilon(1:end-1,1:end-1)./dx).*diff(Ez_p(:,1:end-1),1,1));

    Hx(1:end-1,1:end-1) = az(1:end-1,1:end-1).*(bz(1:end-1,1:end-1).*Hx_p(1:end-1,1:end-1) + 1./(ax(1:end-1,1:end-1).*mu(1:end-1,1:end-1)).*Bx(1:end-1,1:end-1) - ...
        bx(1:end-1,1:end-1)./mu(1:end-1,1:end-1).*Bx_p(1:end-1,1:end-1));
    Hy(1:end-1,1:end-1) = ax(1:end-1,1:end-1).*(bx(1:end-1,1:end-1).*Hy_p(1:end-1,1:end-1) + 1./(ay(1:end-1,1:end-1).*mu(1:end-1,1:end-1)).*By(1:end-1,1:end-1) - ...
        by(1:end-1,1:end-1)./mu(1:end-1,1:end-1).*By_p(1:end-1,1:end-1));

    Dz(2:end-1,2:end-1) = ax(2:end-1,2:end-1).*(bx(2:end-1,2:end-1).*Dz_p(2:end-1,2:end-1) + (epsilon(2:end-1,2:end-1)./dx).*diff(Hy(1:end-1,2:end-1),1,1) - ...
        (epsilon(2:end-1,2:end-1)./dy).*diff(Hx(2:end-1,1:end-1),1,2));

    Ez(2:end-1,2:end-1) = ay(2:end-1,2:end-1).*(by(2:end-1,2:end-1).*Ez_p(2:end-1,2:end-1) + 1./(epsilon(2:end-1,2:end-1).*az(2:end-1,2:end-1)).*Dz(2:end-1,2:end-1) - ...
        (bz(2:end-1,2:end-1)./epsilon(2:end-1,2:end-1)).*Dz_p(2:end-1,2:end-1) - Jz_n);
    

    % Save current time step as previous time
    Bx_p = Bx;
    By_p = By;
    Hx_p = Hx;
    Hy_p = Hy;
    Dz_p = Dz;
    Ez_p = Ez;

    % Apply periodic boundary conditions
    % Hx(end, :) = Hx(1, :);
    % Hx(:, end) = Hx(:, 1);
    % Hy(end, :) = Hy(1, :);
    % Hy(:, end) = Hy(:, 1);
    % Ez(end, :) = Ez(1, :);
    % Ez(:, end) = Ez(:, 1);

    % if max(max(Ez(pml_dim+1:end-pml_dim,pml_dim+1:end-pml_dim))) > Ez_max
    %     [tmp1, tmp2] = find(Ez==max(max(Ez)));
    %     if Jz(tmp1,tmp2) == 0
    %         % Dont update with Ez values from current sources
    %         Ez_max = max(max(Ez(pml_dim+1:end-pml_dim,pml_dim+1:end-pml_dim)));
    %     end
    % end

    % Plot E field
    % imagesc((Ez/1e-6)');
    imagesc((Ez(pml_dim+1:end-pml_dim-1,pml_dim+1:end-pml_dim-1)/1e-6)'); %[output:155ba681]
    title(["Electric Field" string(t/1e-9)+" ns"],FontSize=14)
    xlabel("X Grid Points")
    ylabel("Y Grid Points")
    clim([-Ez_max/1e-6 Ez_max/1e-6])
    cb = colorbar;
    cb.Title.String = '\muV/m';
    set(gca,'YDir','normal');
    set(gcf,'Units','normalized','Position',[0 0 0.5 0.5]); 
    daspect([1 1 1])

    pause(1e-12) % Animate
end %[output:group:74088fbb]
toc %[output:485b155f]
%%
% Calculate RMS field for last time step accross an entire wavelength
rms_cells = lambda/dx; % Average out pattern over one wavelength (one period)

% Calculate projection over plane or RMS value
Ez_rms = rms(Ez(end-pml_dim-2-rms_cells:end-pml_dim-2,pml_dim+1:end-pml_dim-1),1);

close all;
figure(); %[output:86d25ab1]
    set(gcf,'Units','normalized','Position',[0 0 0.5 0.5]);  %[output:86d25ab1]
h1 = subplot(1,2,1); %[output:86d25ab1]
    % Plot E field in region
    imagesc((Ez(pml_dim+1:end-pml_dim-1,pml_dim+1:end-pml_dim-1)/1e-6)'); %[output:86d25ab1]
    title("E_z Field Intensity [\muV/m]",'FontSize',14) %[output:86d25ab1]
    xlabel("X Grid Points",'FontSize',12) %[output:86d25ab1]
    ylabel("Y Grid Points",'FontSize',12) %[output:86d25ab1]
    clim([-Ez_max/1e-6 Ez_max/1e-6]) %[output:86d25ab1]
    axis tight %[output:86d25ab1]
    cb = colorbar; %[output:86d25ab1]
    cb.Title.String = '\muV/m'; %[output:86d25ab1]
    set(gca,'YDir','normal'); %[output:86d25ab1]
    daspect([1 1 1]) %[output:86d25ab1]
h2 = subplot(1,2,2); %[output:86d25ab1]
    % Plot RMS E field projection at "farfield"
    plot(Ez_rms/1e-6,1:size(Ez_rms,2)) %[output:86d25ab1]
    title("E_z on Right X-Z Plane",'FontSize',14) %[output:86d25ab1]
    xlabel("RMS Field Intensity [\muV/m]",'FontSize',12) %[output:86d25ab1]
    ylabel("Y Grid Points",'FontSize',12) %[output:86d25ab1]
    axis tight %[output:86d25ab1]
    h2.PlotBoxAspectRatio = h1.PlotBoxAspectRatio; %[output:86d25ab1]
    h2.PlotBoxAspectRatio(1) = h2.PlotBoxAspectRatio(1)/2; %[output:86d25ab1]
    set(h1,'Units','normalized','Position',[0.06 0.01 0.5 1]); %[output:86d25ab1]
    set(h2,'Units','normalized','Position',[0.7 0.01 0.25 1]); %[output:86d25ab1]
%%
if XP >= 31 || XP == 14
    % Plot as antena pattern
    figure();
    polarplot(linspace(-pi/2,pi/2,size(Ez_rms,2)),Ez_rms/max(Ez_rms),'DisplayName','Farfield')
    Ez_rms(Ez_rms<db2mag(mag2db(max(Ez_rms))-6)) = 0;
    
    % Estimate beamwidth from plot result
    BW = linspace(-pi/2,pi/2,size(Ez_rms,2));
    BW = BW(Ez_rms/max(Ez_rms) > 0.5);
    BW = BW(end) - BW(1);
    Gain = 20*log10(2/(1-cos(BW/2)));

    title("Estimated Antenna Gain: " + string(Gain) + " dB",FontSize=14)
end
%%
% Compare 2D FDTD w/ AA-PML code to analytical solution
if XP == 0
    figure();
    % Calculate analytical solution
    k = (2*pi*f)/c;
    kp = 0:k*dx:k*(x_dim-2*pml_dim*dx)/2;
    Ez_validation = -k^2*Jz(Nx/2,Ny/2)/(4*2*pi*f*epsilon_0)*besselh(0,2,kp).*exp(1j*2*pi*f*t);

    % Plot analytical solution at t_stop and compare to simulation results
    plot(0:dx:(x_dim/2-pml_dim*dx),Ez(Nx/2:end-2*pml_dim,Ny/2),'DisplayName','Simulation')
    hold on
    plot(0:dx:(x_dim/2-pml_dim*dx),max(real(Ez_validation))/max(Ez(:,Ny/2))*Ez(Nx/2:end-2*pml_dim,Ny/2),'DisplayName','Scaled Simulation')
    plot(kp/k,real(Ez_validation),'DisplayName','Analytical Re')
    plot(kp/k,real(Ez_validation),'--','DisplayName','Analytical Im')
    hold off
    title("Infinite Wire Solution Validation",'FontSize',14)
    xlabel("Distance from current source [m]",'FontSize',14)
    ylabel("E Field Intensity [V/m]",'FontSize',14)
    legend('Location','southeast')
    % set(gcf,'Units','normalized','Position',[0 0 0.5 0.5]);
    axis tight
end   
%%
function binaryArray = rectangleArray(Nx_,Ny_,dx_, dy_, x_start_, y_start_) % Generate a rectangle
    % Initialize binary array with zeros
    binaryArray = zeros(Nx_, Ny_);
    
    % Generate a circle
   binaryArray(x_start_:x_start_+dx_,y_start_:y_start_+dy_) = 1;
end
function binaryArray = circleArray(Nx_,Ny_,R_, centerX_, centerY_) % Generate a circle
    % Initialize binary array with zeros
    binaryArray = zeros(Nx_, Ny_);
    
    % Generate a circle
    [X, Y] = meshgrid(1:Nx_, 1:Ny_);
    distanceToCenter = sqrt((X' - centerX_).^2 + (Y' - centerY_).^2);
    binaryArray(distanceToCenter <= R_) = 1;
end
function binaryArray = ellipseArray(Nx_,Ny_,Rx_, Ry_, centerX_, centerY_) % Generate ellipse
    % Initialize binary array with zeros
    binaryArray = zeros(Nx_, Ny_);
    
    % Generate a circle
    [X, Y] = meshgrid(1:Nx_, 1:Ny_);
    ellipseEquation = ((X' - centerX_) / Rx_).^2 + ((Y' - centerY_) / Ry_).^2 <= 1;
    binaryArray(ellipseEquation) = 1;
end

